import requests
import json,boto3
from botocore.client import Config
import base64
import uuid



def lambda_handler(event, context):
    # TODO implement

    try:
        s3 = boto3.client("s3")

        image_64_encode = b""
        image_64_decode = base64.decodebytes(image_64_encode)

        file_type = ".jpg"
        file_uuid = uuid.uuid4().hex
        filename = file_uuid + file_type
        BUCKET_NAME = "eatz-lib"

        s3 = boto3.resource(
            's3',
            aws_access_key_id="ENTER_AWS_ACCESS_KEY",
            aws_secret_access_key="ENTER_AWS_SECRET_KEY",
            config=Config(signature_version="s3v4")
        )
        s3.Bucket(BUCKET_NAME).put_object(Key=filename, Body=image_64_decode)

        result = {'status': True, "message": "Image Upload Success...", "filename": filename}

        print(result)

    except Exception as e:

        result = {'status': False, "message": "Image Upload Failure..." + e}
        print(result)

    # Add Header to every Response
    response_headers = {
        "headers": {
            "Access-Control-Allow-Origin": "*",
            "Access-Control-Allow-Headers": "Origin, X-Requested-With, Content-Type, Accept"
        }
    }

    result.update(response_headers)

    return result